import '../css/Navigation.css'
const TopBar = () => {

    return (
        <nav class="top-container">

            <header class="menu-superior">

                <h1>Insumos Agropecuários</h1>
            </header>


            <div class="navegacao">
                <button onclick="renderMain()">Calculadora</button>
                <button>Cotação</button>
            </div>
            <button>Entre</button>

        </nav>
    );
}

export default TopBar;
